Here's a high-level overview of how you can create a Rust app that supports the elevenlabs.io API and reads the contents of the clipboard aloud using TTS:

**Step 1: Set up a new Rust project**

Create a new Rust project using `cargo`:
```bash
cargo new elevenlabs_tts
```
**Step 2: Add dependencies**

Add the following dependencies to your `Cargo.toml` file:
```toml
[dependencies]
reqwest = "0.11.10"
serde = { version = "1.0.130", features = ["derive"] }
serde_json = "1.0.64"
clipboard = "0.5.0"
tts = "0.1.0"  // or any other TTS library you prefer
```
**Step 3: Create a struct to hold the API credentials**

Create a new file `api_credentials.rs` with the following content:
```rust
pub struct ApiCredentials {
    pub api_key: String,
    pub api_secret: String,
}

impl ApiCredentials {
    pub fn new(api_key: String, api_secret: String) -> Self {
        ApiCredentials { api_key, api_secret }
    }
}
```
**Step 4: Implement the API client**

Create a new file `api_client.rs` with the following content:
```rust
use reqwest;
use serde::{Deserialize, Serialize};

#[derive(Debug, Serialize, Deserialize)]
struct ElevenLabsApiRequest {
    text: String,
}

#[derive(Debug, Serialize, Deserialize)]
struct ElevenLabsApiResponse {
    audio_url: String,
}

pub struct ElevenLabsApiClient {
    api_credentials: ApiCredentials,
}

impl ElevenLabsApiClient {
    pub fn new(api_credentials: ApiCredentials) -> Self {
        ElevenLabsApiClient { api_credentials }
    }

    pub async fn get_audio_url(&self, text: String) -> Result<String, reqwest::Error> {
        let request = ElevenLabsApiRequest { text };
        let response = reqwest::Client::new()
            .post("https://api.elevenlabs.io/v1/text-to-speech")
            .header("Authorization", format!("Bearer {}", self.api_credentials.api_key))
            .json(&request)
            .send()
            .await?;

        let response: ElevenLabsApiResponse = response.json().await?;
        Ok(response.audio_url)
    }
}
```
